import React, { useState } from 'react';

const reviewsData = [
  {
    id: 1,
    name: 'Priya Patel',
    rating: 4,
    comment: 'The Tasty Sweets Are Simply Divine. Every Bite Of The Cake Was Moist And Delicious. A Real Treat!',
    image: 'https://randomuser.me/api/portraits/women/65.jpg',
  },
  {
    id: 2,
    name: 'Rahul Gupta',
    rating: 4,
    comment: 'TastyBites Breakfast Is Truly Satisfying! They Always Hit The Spot For Me.',
    image: 'https://randomuser.me/api/portraits/men/43.jpg',
  },
  {
    id: 3,
    name: 'Meera Pandi',
    rating: 4,
    comment: "It's The Ultimate Comfort Food To Start Your Day With. Highly Recommend!",
    image: 'https://randomuser.me/api/portraits/women/44.jpg',
  },
];

const Review = () => {
  const [reviews, setReviews] = useState(reviewsData);
  const [newReview, setNewReview] = useState({ name: '', rating: 0, comment: '', image: '' });

  const renderStars = (count) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span key={i} style={{ color: i <= count ? '#d32f2f' : '#ccc', fontSize: '18px' }}>
          &#9733;
        </span>
      );
    }
    return stars;
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewReview({ ...newReview, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newReview.name && newReview.rating > 0 && newReview.comment) {
      setReviews([...reviews, { ...newReview, id: reviews.length + 1, image: 'https://randomuser.me/api/portraits/lego/1.jpg' }]);
      setNewReview({ name: '', rating: 0, comment: '', image: '' });
    }
  };

  return (
    <div className="review-section">
      <h2 className="review-heading">
        Our Customers <span className="highlight">Reviews</span>
      </h2>
      <div className="review-cards">
        {reviews.map((review) => (
          <div key={review.id} className="review-card">
            <div className="avatar-wrapper">
              <img src={review.image} alt={review.name} className="avatar" />
            </div>
            <h3 className="reviewer-name">{review.name}</h3>
            <div className="star-rating">{renderStars(review.rating)}</div>
            <p className="review-text">{review.comment}</p>
          </div>
        ))}
      </div>

      <h2 className="review-heading" style={{ marginTop: '50px' }}>Add a Review</h2>
      <form className="review-form" onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          placeholder="Your Name"
          value={newReview.name}
          onChange={handleInputChange}
          required
          className="review-input"
        />
        <select
          name="rating"
          value={newReview.rating}
          onChange={handleInputChange}
          required
          className="review-select"
        >
          <option value={0}>Select Rating</option>
          <option value={1}>1 - Poor</option>
          <option value={2}>2 - Fair</option>
          <option value={3}>3 - Good</option>
          <option value={4}>4 - Very Good</option>
          <option value={5}>5 - Excellent</option>
        </select>
        <textarea
          name="comment"
          placeholder="Your Review"
          value={newReview.comment}
          onChange={handleInputChange}
          required
          className="review-textarea"
        />
        <button type="submit" className="btn-place-order" style={{ marginTop: '15px', width: 'auto' }}>
          Submit Review
        </button>
      </form>
    </div>
  );
};

export default Review;
